import { css } from "@emotion/react";
import { FarmPool } from "./FarmPool";
import { FARMS } from "src/config";
import { SimpleTable } from "src/components/SimpleTable"

export const FarmView: React.FC = () => {
  return (
        <SimpleTable>
          <thead>
            <tr>
              <th
                css={css`
                  text-align: left !important;
                `}
              >
                Pool
              </th>
              <th>Projected APY</th>
              <th>Underlying Tokens</th>
              <th>Max Leverage</th>
              <th />
            </tr>
          </thead>
          <tbody>
            {FARMS.map((farm) => (
              <FarmPool key={farm.name} name={farm.name} tokens={farm.tokens} />
            ))}
          </tbody>
        </SimpleTable>
  );
};
